import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from "react";
import Login from './pages/Login'
import Home from "./pages/Home";
import ForgotPassWord from "./pages/ForgotPassWord";
import Product from "./pages/Product";
import Service from "./pages/Service";
import GioiThieu from "./pages/GioiThieu";
import PageQuanTri from "./pages/PageQuanTri";
import FormBooking2 from "./components/FormBooking2";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/forgotpassword" element={<ForgotPassWord />} />
          <Route path="/sanpham" element={<Product />} />
          <Route path="/dichvu" element={<Service />} />
          <Route path="/gioithieu" element={<GioiThieu />} />
          <Route path="pagequantri" element={<PageQuanTri />} />
          <Route path="dat-lich" element={<FormBooking2 />} />


        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
